-- Creating Tables

CREATE TABLE Department (
    D_ID INT PRIMARY KEY,
    D_Name VARCHAR(255),
    Max_Size INT
);

CREATE TABLE Instructor (
    I_ID INT PRIMARY KEY,
    S_Frame VARCHAR(255),
    S_Lname VARCHAR(255),
    Phone VARCHAR(20),
    Salary DECIMAL(10,2),
    Email VARCHAR(255),
    Gender VARCHAR(10),
    Title VARCHAR(50),
    D_ID INT,
    FOREIGN KEY (D_ID) REFERENCES Department(D_ID)
);

CREATE TABLE Students (
    S_ID INT PRIMARY KEY,
    F_Name VARCHAR(255),
    L_Name VARCHAR(255),
    Birth_Date VARCHAR(255),
    Address VARCHAR(255),
    Email VARCHAR(255),
    Phone VARCHAR(20),
    D_ID INT,
    FOREIGN KEY (D_ID) REFERENCES Department(D_ID)
);
alter table students add Stage int
CREATE TABLE Courses (
    C_ID INT PRIMARY KEY,
    C_Name VARCHAR(255),
    Max_Grade INT,
    Price DECIMAL(10,2)
);
alter table courses add I_ID number REFERENCES instructor(I_ID)
alter table Courses add Stage INT;
alter table Courses add D_ID INT;
ALTER TABLE Courses ADD CONSTRAINT FK_Courses_Department FOREIGN KEY (D_ID) REFERENCES Department(D_ID);

CREATE TABLE Student_Course (
    S_ID INT,
    C_ID INT,
    Grade INT,
    PRIMARY KEY (S_ID, C_ID),
    FOREIGN KEY (S_ID) REFERENCES Students(S_ID),
    FOREIGN KEY (C_ID) REFERENCES Courses(C_ID)
);

CREATE TABLE Course_Department (
    C_ID INT,
    D_ID INT,
    PRIMARY KEY (C_ID, D_ID),
    FOREIGN KEY (C_ID) REFERENCES Courses(C_ID),
    FOREIGN KEY (D_ID) REFERENCES Department(D_ID)
);

